import React, { useState } from "react";
import { Form, Field, withFormik } from "formik";

function LoginForm() {
  const [users, setUsers] = useState([]);

  return (
    <div>
      <Form>
        <Field
          component="input"
          type="text"
          name="username"
          placeholder="Username/Email"
        />
      </Form>
    </div>
  );
}

export default LoginForm;
